import {Link} from 'react-router-dom'

function InfoPage(props){
    const {input} = props;
    return(
        <div>
            <div id="title">
                <Link to="/"><h1>SCAT</h1></Link>
            </div>
            Project Name : {input.name}
        </div>
    );
}

export default InfoPage;
